ISLAMABAD, Dec 24 (APP): Caretaker Chief Minister of Punjab Syed Mohsin Raza Naqvi on Sunday called on Caretaker Prime Minister Anwaar-ul-Haq Kakar .
During the meeting, different matters related to the province were discussed, PM Office Media Wing said in a press release.
